```// Should return a string representing the ranges
function toRange(arr) {
  var ranges = [];
  var partiallySorted = arr.sort(function(a, b) { 
      return a - b;
    })
  var sorted = partiallySorted.filter(function(elem, idx, orig) {
      return orig.indexOf(elem) === idx
    });
  var i = 0;

  while (i &lt; sorted.length) {
    var range = [];

    while (sorted[i] === sorted[i + 1] - 1) {
      if (range[0] !== undefined) {
        range[1] = sorted[i + 1];
      } else {
        range[0] = sorted[i];
        range[1] = sorted[i + 1];
      }
      i++;
    }

    if (range.length === 0) {
      ranges.push(sorted[i].toString())
    } else {
      ranges.push(range.join("_"));
    }
    i++;
  }
  return ranges.join(",");
}

// Should return an array
function toArray(str) {
  if (str.length === 0) return [];
  var numbers = [];
  var split = str.split(",");
  for (var i = 0; i &lt; split.length; i++) {
    if (split[i].indexOf("_") !== -1) {
      var range = split[i].split("_");
      for (var j = Number(range[0]); j &lt;= Number(range[1]); j++) {
        numbers.push(j);
      }
    } else {
      numbers.push(parseInt(split[i]));
    }
  }
  return numbers;
}




